import React from "react";
import { Route, Redirect, Switch } from "react-router-dom";
import Main from "./Pages/Main";
import PricesAndServices from "./Pages/PricesAndServices";
import WindowPage from "./Pages/WindowPage";
import ErrorPopup from "./Components/UI/ErrorGroup/ErrorPopup";
import SuccessPopup from "./Components/UI/ErrorGroup/SuccessPopup";

function App() {
  const onCloseHandler = () => {

  }
  return (
    <Switch>
      <Route exact path="/">
        {/* <Redirect to="/main" /> */}
        <ErrorPopup duration = "5000" onClose={onCloseHandler}/>
        <SuccessPopup duration = "5000" onClose={onCloseHandler}/>
      </Route>
      <Route path="/main">
        <Main />
      </Route>
      <Route path="/pricesAndServices" exact>
        <PricesAndServices />
      </Route>
      <Route path="/pricesAndServices/:id">
        <WindowPage />
      </Route>
      <Route path="*">
        <p>Page Not Found</p>
      </Route>
    </Switch>
  );
}

export default App;
